import { isEmptyWork } from "../../hooks/workList/work/useWorkList";
import { TimeRecordBtn } from "../worklist/element/timeBtn/TimeRecordBtn";
const workItemContent = (workItem, idx) => (
  <li
    className="workList__work tooltip"
    style={{ backgroundColor: workItem.workColor }}
    key={"_" + idx}
  ></li>
);
export const View = ({ viewObj, setDate, viewDate }) => {
  const wakeItem = (
    <li
      className={
        viewObj?.wakeTime
          ? "workList__wakeTime-display workList__time-display workList__time workList__wakeTime listView__item"
          : "empty-element workList__wakeTime-btn workList__time-btn workList__time workList__wakeTime listView__item"
      }
    ></li>
  );
  const bedItem = (
    <li
      className={
        viewObj?.bedTime
          ? "workList__bedTime-display workList__time-display workList__time workList__bedTime listView__item"
          : "empty-element workList__bedTime-btn workList__time-btn workList__time workList__bedTime listView__item"
      }
    ></li>
  );

  const workListItem =
    viewObj?.workList &&
    Object.values(viewObj?.workList).map((workItem, idx) => {
      return isEmptyWork(workItem) ? "" : workItemContent(workItem, idx);
    });
  const viewContent = (
    <ol>
      {wakeItem} {workListItem} {bedItem}
    </ol>
  );
  return <li> {viewContent}</li>;
};

